// import { createApp } from 'vue'
// import App from './App.vue'

// createApp(App).mount('#app')



import Vue from "vue";
import App from "./App.vue";
import router from "./router";  // 引入路由配置

Vue.config.productionTip = false;

new Vue({
  router, // 將路由注入到 Vue 實例
  render: (h) => h(App),
}).$mount("#app");
